import React from "react";

const Display = (props) => {
  const { infoList } = props;

  return (
    <div>
      {/* Display the values from the infoList array */}
      {infoList.map((info, index) => (
        <div key={index}>
          <h1>Name: {info.name}</h1>
          <p>Age: {info.age}</p>
          <p>City: {info.city}</p>
          {/* Add additional fields as needed */}
        </div>
      ))}
    </div>
  );
};

export default Display;
